export function normalizeAnswer(value: string): string {
  return value
      .toLowerCase()
      .normalize('NFD')
      .replace(/\p{Diacritic}/gu, '')
      .replace(/[^a-z0-9äöüß\s\.]/g, '')
      .replace(/\s+/g, ' ')
      .trim();
}